import React, { Component, useEffect, useState } from "react";
import { Form, InputGroup } from "react-bootstrap";
import { Grid, TextField } from "@mui/material";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

export default function RepairInfoAdmin() {
  const [search, setSearch] = useState("");
  const [loading, setLoading] = useState(true);
  const [items, setItems] = useState([]);

  const handleInputChange = (e) => {
    setSearch(e.target.value);
  };

  useEffect(() => {
    Promise.all([MotorcycleGet(), UserGet(), RepairGet()])
      .then(([motorcycles, users, repaildataes]) => {
        const filteredItems = motorcycles.filter((item) => item.USER_ID !== null);
        setItems(
          repaildataes.map((item) => {
            const motorcycle = motorcycles.find((m) => m.MOTORCYCLE_ID === item.MOTORCYCLE_ID);
            const user = users.find((u) => u.USER_ID === motorcycle.USER_ID);
            return {
              ...item,
              MOTORCYCLE_ID: motorcycle ? motorcycle.MOTORCYCLE_ID : "N/A",
              USER_FULLNAME: user ? user.USER_FULLNAME : "N/A",
            };
          })
        );
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
        setLoading(false);
      });
  }, []);
  
  const MotorcycleGet = () => {
    return fetch("http://localhost:3001/api/v1/motorcycles")
      .then((res) => res.json())
      .then((result)=> {
        return result.map((motorcycle) => ({
          MOTORCYCLE_ID : motorcycle.MOTORCYCLE_ID
        }));
      })
      .catch((error) => {
        console.error("Error fetching motorcycles:", error);
        return [];
      });
  };

  const UserGet = () => {
    return fetch("http://localhost:3001/api/v1/users")
      .then((res) => res.json())
      .then((result) => {
        return result.map((user) => ({
          USER_ID: user.USER_ID,
          USER_FULLNAME: user.USER_FULLNAME,
        }));
      })
      .catch((error) => {
        console.error("Error fetching users:", error);
        return [];
      });
  };

  const RepairGet = () => {
    return fetch("http://localhost:3001/api/v1/repaildataes")
      .then((res) => res.json())
      .catch((error) => {
        console.error("Error fetching repaildataes:", error);
        return [];
      });
  };

  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  return (
    <div>
      <Row>
          <Col>
            <Grid item xs={12} sm={6}>
              <TextField
                id="RegistrationNumber"
                label="ชื่อ-นามสกุล"
                variant="outlined"
                fullWidth
                required
                //onChange={(e) => setRegistrationNumber(e.target.value)}
              ></TextField>
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                id="BucketNumber"
                label="เบอร์โทร"
                variant="outlined"
                fullWidth
                required
                //onChange={(e) => setBucketNumber(e.target.value)}
              ></TextField>
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                id="Model"
                label="เลขตัวถัง"
                variant="outlined"
                fullWidth
                required
                //onChange={(e) => setModel(e.target.value)}
              ></TextField>
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                id="Color"
                label="อาการ"
                variant="outlined"
                fullWidth
                required
                //onChange={(e) => setColor(e.target.value)}
              ></TextField>
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                id="Price"
                label="วันที่"
                variant="outlined"
                fullWidth
                required
                //onChange={(e) => setPrice(e.target.value)}
              ></TextField>
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                id="Balance"
                label="สถานะ"
                variant="outlined"
                fullWidth
                required
                //onChange={(e) => setBalance(e.target.value)}
              ></TextField>
            </Grid>
            <button
              type="submit"
              variant="contained"
              class="btn btn-primary mb-3"
            >
              บันทึก
            </button>
          </Col>
        <Col></Col>
      </Row>
    </div>
  );
}
